e –∫ –Ω—ã–Ω–µ—à–Ω–µ–π —Å–∏—Ç—É–∞—Ü–∏–∏.\n\n7) –°–æ–∑–Ω–∞—Ç–µ–ª—å–Ω–æ–µ ‚Äî $consciousCard (45-55 —Å–ª–æ–≤): —Ü–µ–ª–∏, –æ–∂–∏–¥–∞–Ω–∏—è –∏–ª–∏ —Ç–æ, —á—Ç–æ $userName –æ—Å–æ–∑–Ω–∞—ë—Ç.\n\n8) –ë–ª–∏–∂–Ω–µ–µ –±—É–¥—É—â–µ–µ ‚Äî $hiddenCard (45-55 —Å–ª–æ–≤): –≤–µ—Ä–æ—è—Ç–Ω–æ–µ —Ä–∞–∑–≤–∏—Ç–∏–µ –≤ –±–ª–∏–∂–∞–π—à–∏–µ –Ω–µ–¥–µ–ª–∏.\n\n9) –í–Ω—É—Ç—Ä–µ–Ω–Ω–µ–µ –Ø ‚Äî $selfCard (45-55 —Å–ª–æ–≤): —Å–æ—Å—Ç–æ—è–Ω–∏–µ, —Ä–µ—Å—É—Ä—Å—ã $userName.\n\n10) –û–∫—Ä—É–∂–µ–Ω–∏–µ ‚Äî $environmentCard (45-55 —Å–ª–æ–≤): –≤–ª–∏—è–Ω–∏–µ –ª—é–¥–µ–π –∏ –æ–±—Å—Ç–æ—è—Ç–µ–ª—å—Å—Ç–≤.\n\n11) –ù–∞–¥–µ–∂–¥—ã / —Å—Ç—Ä–∞—Ö–∏ ‚Äî $hopesCard (45-55 —Å–ª–æ–≤): –æ–∂–∏–¥–∞–Ω–∏—è –∏–ª–∏ –æ–ø–∞—Å–µ–Ω–∏—è $userName.\n\n12) –ò—Ç–æ–≥ ‚Äî $outcomeCard (45-55 —Å–ª–æ–≤): –≤–µ—Ä–æ—è—Ç–Ω—ã–π —Ä–µ–∑—É–ª—å—Ç–∞—Ç –ø—Ä–∏ —É—á—ë—Ç–µ —Å–æ–≤–µ—Ç–∞ —Ä–∞—Å–∫–ª–∞–¥–∞.\n\n13) –ó–∞–∫–ª—é—á–µ–Ω–∏–µ: –¥—Ä—É–∂–µ—Å–∫–∞—è –ø–æ–¥–¥–µ—Ä–∂–∫–∞ –∏ –ø–æ–∑–∏—Ç–∏–≤–Ω–∞—è –∞—Ñ—Ñ–∏—Ä–º–∞—Ü–∏—è (30-35 —Å–ª–æ–≤) –¥–ª—è $userName.\n\n–¢—Ä–µ–±–æ–≤–∞–Ω–∏—è: –æ–±—â–∏–π –æ–±—ä—ë–º 400-500 —Å–ª–æ–≤, –∂–∏–≤–æ–π —Ä–∞–∑–≥–æ–≤–æ—Ä–Ω—ã–π —Ç–æ–Ω, 4-6 —ç–∑–æ—Ç–µ—Ä–∏—á–µ—Å–∫–∏—Ö —ç–º–æ–¥–∑–∏; –∫–∞–∂–¥—ã–π –±–ª–æ–∫ –æ—Ç–¥–µ–ª—è–π –¥–≤–æ–π–Ω—ã–º –ø–µ—Ä–µ–≤–æ–¥–æ–º —Å—Ç—Ä–æ–∫–∏ (\n\n); –Ω–µ –∏—Å–ø–æ–ª—å–∑—É–π —Å–∏–º–≤–æ–ª—ã *, # –∏–ª–∏ –¥—Ä—É–≥—É—é —Ä–∞–∑–º–µ—Ç–∫—É; –ø–∏—à–∏ —Ç–æ–ª—å–∫–æ –ø—Ä–æ—Å—Ç—ã–º —Ç–µ–∫—Å—Ç–æ–º.';
